import React from "react";
import { NavLink } from "react-router-dom";

export const SideBarTab = ({ path, label }) => {
  return (
    <NavLink
      to={path}
      end
      className={({ isActive }) =>
        isActive ? "text-3xl text-red" : "text-3xl text-white"
      }
    >
      {label}
    </NavLink>
  );
};
